import React from "react";
import "./Card.css"

const Card= (props)=>{
    return(
        <div className="contenedor">
            <div> 
           <h2 className="titulo">{props.todo.titulo} </h2>
           </div>
           <h2>{props.todo.responsable}</h2>
           <h2>{props.todo.descripcion}</h2>
           <h2>{props.todo.vprioridad}</h2>
        </div>
    )
}
export default Card;
